import '../C_dashboard/style_dashboard.css';
import React from 'react';


function NavBar(props) {
  
  return (    
    <div>
      <h1>Actual navbar option: {props.menubar_option}</h1>
      if (props.menubar_option === "home"){
        <h1>Rendered navbar option: home</h1>
      }
      if (props.menubar_option === "notifications"){
        <h1>Rendered navbar option: notifications</h1>
      } 
    </div>  
  );
}

export default NavBar;
